window.bookSummaryJSON = "<p>How many lives would you spend to find your beloved?</p> <p>Dominick Davidner was murdered. Then things got worse.</p> <p>Instead of going on to the afterlife, Dominick found himself back in his nine-year-old body, all memories of his previous life intact. All he can think about is Emily, the love of his life, left behind when he died.</p> <p>Unfortunately, she is now thousands of miles away. How can Dominick find his way back to the woman he loves, and what will he say if he finds her?</p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
